class Solution:
    def maxOperations(self, s: str) -> int:
        res = 0
        iCnt = 0
        i = 0
        while i < len(s):
            if s[i] == "1":
                iCnt += 1
                i += 1
            else:
                while i < len(s) and s[i] == "0":
                    i += 1
                res += iCnt
        return res
